from collections import defaultdict

class Solution:
    def isAnagram(self, s: str, t: str) -> bool:
        t_map = defaultdict(int)
        s_map = defaultdict(int)

        for tc in t:
            t_map[tc] += 1

        for sc in s:
            s_map[sc] += 1

        if len(t_map) != len(s_map):
            return False

        for c in t_map:
            if c not in s_map:
                return False

            if s_map[c] != t_map[c]:
                return False

        return True

    def isAnagram2(self, s:str, t:str) -> bool:
        if len(s) != len(t):
            return False

        return sorted(s) == sorted(t)

    def isAnagram3(self, s: str, t: str) -> bool:
        if len(s) != len(t):
            return False

        count = defaultdict(int)

        for i in range(len(s)):
            count[s[i]] += 1
            count[t[i]] -= 1

        for n in count.values():
            if n != 0:
                return False

        return True


a = ""
b = ""
if __name__ == "__main__":
    s = Solution()
    assert s.isAnagram('aaccb', 'caac') == False
    assert s.isAnagram(a, b) == True
    assert s.isAnagram('anagram', 'nagaram') == True

    assert s.isAnagram2('aaccb', 'caac') == False
    assert s.isAnagram2(a, b) == True
    assert s.isAnagram2('anagram', 'nagaram') == True

    assert s.isAnagram3('aaccb', 'caac') == False
    assert s.isAnagram3(a, b) == True
    assert s.isAnagram3('anagram', 'nagaram') == True